import React from 'react';
import '../styles/index.scss';


function RegisterPage(){
  return (
    <form>
      <h1>Register</h1>
      <input 
        type='email' 
        className='register-input-form' 
        placeholder="login" 
        onFocus={()=> this.placeholder=''} 
        onBlur={()=> this.placeholder='login'} 
        required
      />
      <input type='email' className='register-input-form' placeholder='email@gmail.com' required></input>
    </form>
  );
}

export default RegisterPage;
